import React, { useState } from 'react';
import './SideNavBar.sass'; // Import the SASS file for styling
import HamburgerMenuButton from '../HamburgerMenuButton/HamburgerMenuButton';

interface SideNavBarProps {
    isOpen: boolean;
    onClose: () => void;
}

const SideNavBar: React.FC<SideNavBarProps> = ({ isOpen, onClose }) => {
    const [, setIsNavOpen] = useState(false);

    const handleNavOpen = () => {
        setIsNavOpen(true);
    };

    return (
        <div className={`side-nav-bar ${isOpen ? 'open' : ''}`}>
            <button onClick={onClose} className="close-btn"><HamburgerMenuButton onClick={handleNavOpen} /></button>
            <nav>
                <ul>
                    <li><a href="#home">Home</a></li>
                    <li><a href="#about">About</a></li>
                    <li><a href="#services">Services</a></li>
                    <li><a href="#contact">Contact</a></li>
                </ul>
            </nav>
        </div>
    );
};

export default SideNavBar;
